import styled from "styled-components";

export const OrderPageContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 80vh;
`;

export const TextContainer = styled.span`
  font-size: 30px;
  font-weight: bold;
  margin-bottom: 20px;
`;

export const SpanContainer = styled.span`
  color: crimson;
  font-size: 18px;
`;
